import { Box, Container, Stack } from '@mui/system'
import React from 'react'

function StorePage() {
  
  return (
    <Container>
     <Stack
  direction="column"
  justifyContent="center"
  // alignItems="flex-start"
  // spacing={2}
 
>
  <Stack
  sx={{
    backgroundColor:"#84DE02",
    fontSize:"20px",
    borderRadius:"10px 10px 0 0",
    p:2
  }}
  >
 Product Types
  </Stack>
  <Stack
  sx={{
      backgroundColor:"#fff",
      p:2,
      fontSize:"20px"
  }}
  >
    Fruit
  </Stack>
 <Stack
   sx={{
      backgroundColor:"#80deea",
      p:2,
      fontSize:"20px"
  }}
 >
    Vegetable
  </Stack>
  </Stack>


    </Container>
  )
}

export default StorePage
